import React from "react";
import "./Train_part.css";
import Train_vdo from "./Train_vdo";



function Train_part() {
    return (
        <>
            <div className="Outer_Div">
                <div className="Inner_Div">
                    <table>
                        <tr>
                            <td>
                                <Train_vdo />
                            </td>
                            <td>
                                <Train_vdo />
                            </td>
                        </tr>
                    </table>
                </div>
            </div>
        </>
    );

}
export default Train_part;
